INSERT INTO `sections_contents` VALUES (1040,'How to prove the status of a fellow national (compatriot)?',NULL,1,'<p>When applying for entrance trials, you must provide proof that Your ascendants were Soviet citizens (Your passport and birth certificate with translation into Russian language, passport and birth certificate with translation into Russian language of one of relatives born in the USSR). If a parent has changed his/her last name, you also have to submit a document confirming this (for instance, a marriage certificate) with a translation into Russian.</p>','text',NULL,151,NULL,'2020-10-22 14:02:37','2020-10-22 14:02:37',NULL),(426,'IV. УЧЁТ РЕЗУЛЬТАТОВ ИНДИВИДУАЛЬНЫХ ДОСТИЖЕНИЙ',NULL,3,'<p>Перечень индивидуальных достижений и подтверждающих их документов приведен в таблице:</p><p><img src=\"data:image/png;base64,\"></p><p><img src=\"data:image/png;base64,\"></p>','text',NULL,51,NULL,'2020-06-19 07:59:08','2020-07-14 12:53:46',NULL),(427,'Памятка магистратура 2020','A9mR0Up8qbh78RqhsFYHxf7fH1exCuZxT1ReBMEK.pdf',0,'Памятка-магистры-2020.pdf','file','pyb7zbzwvhdfabgl4dy9jp',NULL,422,'2020-06-19 08:03:36','2020-07-13 13:42:17','pdf'),(428,'Памятка (бакалавриат и специалитет)','e8USZI8z9xbkrcyOCkk0YdQChLX0kXdxmDI78Ykr.pdf',0,'Памятка-бакалавры и специалисты-2020.pdf','file','ceskigh5iq5wm8tbhrsud',NULL,111,'2020-06-19 08:04:25','2020-07-14 10:40:31','pdf'),(429,'Изменения от 18.06.2020','wq0jcmGftFJ4SP9E4fe7FEjGdaGZPRHYkR7bGJFq.pdf',1,'Изменения в Правила СПО_от 18.06.2020.pdf','file','s4w3fhltf6hiny2u855',NULL,119,'2020-06-19 10:15:28','2020-06-19 10:15:28','pdf'),(430,'КОЛИЧЕСТВО МЕСТ ДЛЯ ПРИЕМА ПО КАЖДОЙ СПЕЦИАЛЬНОСТИ, В ТОМ ЧИСЛЕ ПО РАЗЛИЧНЫМ ФОРМАМ ПОЛУЧЕНИЯ ОБРАЗОВАНИЯ',NULL,5,NULL,'files',NULL,13,NULL,'2020-06-19 10:16:58','2020-07-14 12:53:13',NULL),(431,'КОЛИЧЕСТВО МЕСТ ДЛЯ ПРИЕМА ПО КАЖДОЙ СПЕЦИАЛЬНОСТИ, В ТОМ ЧИСЛЕ ПО РАЗЛИЧНЫМ ФОРМАМ ПОЛУЧЕНИЯ ОБРАЗОВАНИЯ','mlGaAMZN1mtE4WbzUMGwUh9qDQQ1vMyoL4APHJcE.pdf',0,'Количество мест для приема 2020 СПО.pdf','f