55','pdf'),(949,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год)','20201022_165855_wuxb0viriII9.pdf',1,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год).pdf','file','6kudt32i2v2m3h1ev4r168',NULL,947,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(950,'Образец договора об оказании платных образовательных услуг','20201022_165855_f7lyfqBi1XtV.pdf',2,'Договор_ВО.pdf','file','5ram7y2lg3kze1mydswaf',NULL,947,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(953,'Правила приема на обучение по образовательным программам высшего образования – программам ординатуры',NULL,0,NULL,'files',NULL,129,NULL,'2020-10-22 13:58:55','2020-10-22 13:58:55',NULL),(1192,'Правила приёма в ординатуру (2021)','X8hwIKte2Nx5CXegNgTVfRoveON0HX11u1BPoOUb.pdf',0,'Правила приема в ординатуру (2021).pdf','file','fp0s2828yho47jx3vqpe',NULL,953,'2021-03-30 20:10:01','2021-03-30 20:10:01','pdf'),(956,'Условия поступления',NULL,1,'<p>&nbsp;Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><p><br></p><p>&nbsp;&nbsp;- раздельно по программам ординатуры в зависимости от специальности;</p><p><br></p><p>&nbsp;&nbsp;- раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</p><p><br></p><p>&nbsp;&nbsp;- <span style=\"color: rgb(73, 78, 83);\">раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приёма на обучение по образовательным программам высшего образования – программам ординатуры в федеральном государственном бюджетном образовательном учреждении высшего образования «Национальный исследовательский Мордовский государственный университет им. Н.П. Огарёва» в 2021/2022 учебном году, и иных иностранных граждан, лиц без гражданства.</span></p>','text',NULL,129,NULL,'2020-10-22 13:58:55','2021-03-30 20:11:30',NULL),(957,'Количество мест для приема на обучение по различным условиям поступления',NULL,2,NULL,'files',NULL,129,NULL,'2020-10-22 13:58:55','2020-10-22 13:58:55',NULL),(1193,'Контрольные цифры приема','urCGw9bp10Pva3cOUmCCGaswhX5LzfHoRhz7xmis.pdf',0,'Контрольные цифры приема (2021).pdf','file','tf05xtly0ureg98pja1xi',NULL,957,'2021-03-30 20:20:19','2021-03-30 20:20:19','pdf'),(964,'',NULL,0,NULL,'files',NULL,130,NULL,'2020-10-22 13:58:55','2020-10-22 13:58:55',NULL),(965,'План целевого приёма в ординатуру в 2020 году','20201022_165855_rl0beitVw9tG.pdf',0,'План целевого приема в ординатуру на 2020 год.pdf','file','bxcw150n75e0zxlcchwdxhq',NULL,964,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(966,'Детализация целевого приёма','20201022_165855_i278qeWZAkQw.pdf',1,'Детализация целевого приёма.pdf','file','u2tnar6c37mwqliu2q16h8',NULL,964,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(967,'',NULL,0,'<p class=\"ql-align-justify\">   Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><ul><li class=\"ql-align-justify\">&nbsp;&nbsp;раздельно по программам ординатуры в зависимости от специальности;</li><li class=\"ql-align-justify\">&nbsp;&nbsp;раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</li><li class=\"ql-align-justify\">&nbsp;&nbsp;раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</li><li class=\"ql-align-justify\">&nbsp;&nbsp;раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приёма на обучение по образовательным программам высшего образования – программам ординатуры в федеральном государственном бюджетном образовательном учреждении высшего образования «Национальный исследовательский Мордовский государственный университет им. Н.П. Огарёва» в 2021/2022 учебном году, и иных иностранных граждан, лиц без гражданства.</li></ul><p><br></p>','text',NULL,131,NULL,'2020-10-22 13:58:55','2021-03-30 21:02:41',NULL),(968,NULL,NULL,0,NULL,'files',NULL,132,NULL,'2020-10-22 13:58:55','2020-10-22 13:58:55',NULL),(969,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства','20201022_165855_yhuabwVkpsUe.pdf',4,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства.pdf','file','hi8a89kkhzf9uhxpbxqfe',NULL,968,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(970,'План приёма в ординатуру в 2020 году на платной основе','20201022_165855_h1vgzjYxtAqP.bin',3,'План приёма в ординатуру в 2020 году на платной основе.pdf','file','duxwy7banfq3uluw6f0eej',NULL,968,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(971,'Контрольные цифры приёма','20201022_165855_an2rk2zhImeq.pdf',0,'Контрольные цифры приема (2020).pdf','file','dvzmqevlytlhwem920yga',NULL,968,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(972,'План целевого приёма в ординатуру в 2020 году','20201022_165855_qsuvitVAqxkq.pdf',1,'План целевого приема в ординатуру на 2020 год.pdf','file','u9r3ramr51psodgunokj8',NULL,968,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(973,'Детализация целевого приёма','20201022_165855_13u28maCb6VN.pdf',2,'Детализация целевого приёма.pdf','file','9bokax4qw5r1cc41vnfglv',NULL,968,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(974,'',NULL,2,NULL,'files',NULL,133,NULL,'2020-10-22 13:58:55','2020-10-22 13:58:55',NULL),(975,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении','20201022_165855_mm2ta7smOsFa.pdf',0,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении.pdf','file','72uisjoiirwclzqqy4j0fm',NULL,974,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(976,'',NULL,0,'<p>	Прием документов на обучение по программам ординатуры осуществляется в следующие сроки:</p><ul><li class=\"ql-align-justify\">на места в рамках контрольных цифр приема - <strong>с 05 июля 2021 г. по 07 августа 2021 г.</strong>;</li><li class=\"ql-align-justify\">по договорам об оказании платных образовательных услуг - <strong>с 05 июля 2021 г. по 24 августа 2021 г.</strong></li></ul><p class=\"ql-align-justify\">	Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места в рамках контрольных цифр приема, завершаются не позднее <strong>11 августа 2021 г.</strong> Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места по договорам об оказании платных образовательных услуг, завершаются не позднее <strong>27 августа 2021 г</strong>.</p><p class=\"ql-align-justify\">	Зачислению на места в рамках контрольных цифр приема подлежат поступающие, представившие оригинал документа установленного образца, <strong>не позднее 18-00 ч. 11 августа 2021 г.</strong></p><p class=\"ql-align-justify\">	<strong>Не позднее 18-00 ч. 11 августа 2021 г. </strong>поступающий на места в рамках контрольных цифр вправе определить приоритет по специальности ординатуры. Выбор приоритета подтверждается оригиналом документа установленного образца.</p><p class=\"ql-align-justify\">	Зачислению на места по договорам об оказании платных образовательных услуг подлежат поступающие, представившие оригинал документа установленного образца (заявление о согласии на зачисление) <strong>не позднее 18-00 ч. 27 августа 2021 г.</strong></p><p><br></p>','text',NULL,133,NULL,'2020-10-22 13:58:55','2021-03-30 20:54:16',NULL),(1194,NULL,NULL,0,'<p class=\"ql-align-justify\">	Документы, необходимые для поступления, представляются (направляются) в Университет одним из следующих способов:</p><p class=\"ql-align-justify\">	- представляются лично поступающим (доверенным лицом) – в этом случае поступающему или доверенному лицу выдается расписка в приеме документов;</p><p class=\"ql-align-justify\">	- направляются через операторов почтовой связи общего пользования ценным письмом с заверенной описью вложения по адресу работы приемной комиссии Университета: г. Саранск, ул. Полежаева, 44/3, Учебный корпус № 28, кабинет № 318 - указанные документы принимаются, если они поступили в Университет не позднее срока завершения приема документов, установленного настоящими Правилами.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">	Возможность подачи документов в электронной форме не предусматривается.</p>','text',NULL,134,NULL,'2021-03-30 20:56:37','2021-03-31 17:08:02',NULL),(981,'Сроки проведения вступительных испытаний в ординатуру',NULL,0,'<p>	Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места в рамках контрольных цифр приема, завершаются не позднее <strong>11 августа 2021 г.</strong> Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места по договорам об оказании платных образовательных услуг, завершаются не позднее <strong>27 августа 2021 г</strong>.</p>','text',NULL,135,NULL,'2020-10-22 13:58:55','2021-03-31 17:17:44',NULL),(982,'Общие правила подачи и рассмотрения апелляций',NULL,3,'<p class=\"ql-align-justify\">	По результатам решения экзаменационной комиссии о прохождении вступительного испытания поступающий (доверенное лицо) вправе подать в апелляционную комиссию апелляцию о нарушении, по мнению поступающего, установленного порядка проведения вступительного испытания и (или) о несогласии с полученной оценкой результатов вступительного испытания.</p><p class=\"ql-align-justify\">	Рассмотрение апелляции не является пересдачей вступительного испытания. В ходе рассмотрения апелляции проверяется соблюдение установленного порядка проведения вступительного испытания и (или) правильность оценивания результатов вступительного испытания.</p><p class=\"ql-align-justify\">	Апелляция подается одним из способов, указанных в п.3.2  Правил приема.</p><p class=\"ql-align-justify\">	Апелляция подается в день объявления результатов вступительного испытания или в течение следующего рабочего дня.</p><p class=\"ql-align-justify\">	Рассмотрение апелляций проводится не позднее следующего рабочего дня после дня подачи апелляции.</p><p class=\"ql-align-justify\">	При рассмотрении апелляции имеют право присутствовать поступающий (доверенное лицо), который должен иметь при себе документ, удостоверяющий его личность.</p><p class=\"ql-align-justify\">	После рассмотрения апелляции апелляционная комиссия принимает решение об изменении оценки результатов вступительного испытания или оставлении указанной оценки без изменения.</p><p class=\"ql-align-justify\">	Оформленное протоколом решение апелляционной комиссии доводится до сведения поступающего (доверенного лица). Факт ознакомления поступающего (доверенного лица) с решением апелляционной комиссии заверяется подписью поступающего (доверенного лица).</p>','text',NULL,135,NULL,'2020-10-22 13:58:55','2021-03-31 17:13:39',NULL),(998,NULL,NULL,0,'<p><span style=\"color: rgb(73, 78, 83);\">Количество мест в общежитиях ФГБОУ ВО «МГУ им. Н.П. Огарёва» для иногородних поступающих в 2021 году - 80 мест.</span></p>','text',NULL,136,NULL,'2020-10-22 13:58:55','2021-03-30 20:55:03',NULL),(999,NULL,NULL,0,NULL,'files',NULL,137,NULL,'2020-10-22 13:58:55','2020-10-22 13:58:55',NULL),(1000,'Приказ о зачислении (целевой приём)','20201022_165855_1a4n53fvjtBN.pdf',0,'Приказ о зачислении (целевой приём).pdf','file','qyj8jk7ebyddcrifujcc0g',NULL,999,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(1001,'Приказ о зачислении (бюджетная основа)','20201022_165855_pbhwzdySwLcC.pdf',1,'Приказ о зачислении (бюджетная основа).pdf','file','0h9mm7nnin9mwg3z7flr7u',NULL,999,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(1002,'Приказ о зачислении (бюджетная основа, дополнительно)','20201022_165855_z5uaqjwlTm7B.pdf',2,'Приказ о зачислении (бюджетная основа, дополнительно).pdf','file','uf45pkx7avd4cey1fsa9t',NULL,999,'2020-10-22 13:58:55','2020-10-22 13:58:55','pdf'),(1003,'Особенности проведения приёма иностранных граждан и лиц без гражданства',NULL,0,'<p>	<strong>1.</strong> Иностранные граждане и лица без гражданства имеют право на получение высшего образования за счет бюджетных ассигнований в соответствии с международными договорами Российской Федерации, федеральными законами или установленной Правительством Российской Федерации квотой на образование иностранных граждан и лиц без гражданства (далее – квота на образование иностранных граждан), а также за счет средств физических лиц и юридических лиц в соответствии с договорами об оказании платных образовательных услуг.</p><p>	</p><p>	<strong>2.</strong> Прием на обучение в пределах квоты на образование иностранных граждан осуществляется в соответствии с направлениями федерального органа исполнительной власти, осуществляющего функции по выработке государственной политики и нормативно-правовому регулированию в сфере образования. Зачисление на обучение в пределах квоты на образование иностранных граждан осуществляется отдельным приказом (приказами) по университету.</p><p><br></p><p>	<strong>3.</strong> Иностранные граждане и лица без гражданства, являющиеся соотечественниками, проживающими за рубежом, имеют право на получение высшего образования наравне с гражданами Российской Федерации при условии соблюдения ими требований, предусмотренных статьей 17 Федерального закона от 24 мая 1999 г. № 99-ФЗ «О государственной политике Российской Федерации в отношении соотечественников за рубежом» (далее – Федеральный закон № 99-ФЗ).</p><p><br></p><p>	<strong>4.</strong> На соотечественников, проживающих за рубежом и не являющихся гражданами Российской Федерации, не распространяются особые права при приеме на обучение по программам бакалавриата и программам специалитета, предоставляемые в соответствии с Федеральным законом № 273-ФЗ, если иное не предусмотрено международным договором Российской Федерации.</p><p><br></p><p>	<strong>5.</strong> При приеме иностранных граждан и лиц без гражданства на обучение по программам бакалавриата и программам специалитета на места по договорам об оказании платных образовательных услуг (платное обучение) вступительные испытания проводятся в соответствии с <a href=\"https://abiturs.mrsu.ru/Inostrannim-abiturientam-Priyom-po-dogovoru\" rel=\"noopener noreferrer\" target=\"_blank\">Перечнем вступительных испытаний для иностранных граждан, поступающих по договорам на оказание платных образовательных услуг</a>. В связи с этим для иностранных граждан и лиц без гражданства выделяется отдельное количество мест для приема и проводится отдельный конкурс на эти места. </p><p>	</p><p>	<strong>6.</strong> Прием документов осуществляется в следующие сроки:</p><p>	1) у иностранных граждан и лиц без гражданства, указанных в пункте 5, в сроки, установленные пунктом 18  <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>; </p><p>	2) прием документов у иностранных граждан и лиц без гражданства,поступающих для обучения по договорам с оплатой стоимости обучения физическими и (или) юридическими лицами, осуществляется в сроки с 20 июня по 17 октября 2020 года.</p><p><br></p><p>	<strong>7.</strong> При подаче документов для поступления на обучение иностранный гражданин или лицо без гражданства указывает в заявлении о приеме реквизиты документа, удостоверяющего личность, либо документа,удостоверяющего личность иностранного гражданина в Российской Федерации или личность лица без гражданства в Российской Федерации в соответствии со статьей 10 Федерального закона от 25 июля 2002 г. № 115-ФЗ «О правовом положении иностранных граждан в Российской Федерации» (далее –документ, удостоверяющий личность иностранного гражданина), и представляет в соответствии с подпунктом 1 пункта 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a> оригинал или копию документа, удостоверяющего личность, гражданство, либо документа, удостоверяющего личность иностранного гражданина. </p><p><br></p><p>	<strong>8.</strong> При поступлении на обучение в соответствии со статьей 17 Федерального закона № 99-ФЗ соотечественник представляет помимо документов, указанных в пункте 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>, оригиналы или копии документов, предусмотренных статьей 17 Федерального закона № 99-ФЗ. Иностранные граждане, которые поступают на обучение на основании международных договоров, представляют помимо документов, указанных в пункте 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил </a>, документы, подтверждающие их отнесение к числу лиц, указанных в соответствующих международных договорах.</p><p><br></p><p><strong>9.</strong> Зачисление иностранных граждан и лиц без гражданства, указанных в пункте 133 настоящих <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>, на места, финансируемые за счет бюджетных ассигнований, проводится в сроки, установленные в пунктах 118-123 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>.</p><p><br></p><p><strong>10.</strong> Зачисление иностранных граждан и лиц без гражданства для обучения на места по договорам об оказании платных образовательных услуг (платное обучение) осуществляются в срок по 24 октября 2020 года.</p><p><br></p><p><strong>11.</strong> Прием иностранных граждан и лиц без гражданства на обучение по образовательным программам, содержащим сведения, составляющие государственную тайну, осуществляется только в пределах квоты на образование иностранных граждан с соблюдением требований, предусмотренных законодательством Российской Федерации о государственной тайне.</p>','text',NULL,138,NULL,'2020-10-22 14:00:19','2020-10-22 14:00:19',NULL),(1004,NULL,NULL,0,'<p>	На подготовительном отделении для иностранных граждан проходят обучение слушатели из разных стран по дополнительной общеобразовательной программе, обеспечивающей подготовку иностранных граждан и лиц без гражданства к освоению профессиональных образовательных программ на русском языке</p><p>&nbsp;</p><p>	<strong>Профили программы обучения:</strong></p><ul><li>естественнонаучный&nbsp;(русский язык, математика, физика и химия);</li><li>инженерно-технический и технологический&nbsp;(русский язык, математика, физика и информатика);</li><li>гуманитарный&nbsp;(русский язык, обществознание, история и литература);</li><li>экономический&nbsp;(русский язык, обществознание, история и математика);</li><li>медико-биологической направленности&nbsp;(русский язык, химии, биология и физика).</li></ul><p><br></p><p>	<strong>Учебный процесс</strong></p><p>	Слушатели подготовительного отделения изучают русский язык, а также общеобразовательные предметы для продолжения обучения. Большую часть подготовительной программы составляет курс&nbsp;русского языка. </p><p>Занятия на подготовительном отделении дают уникальную возможность иностранным слушателям заложить твердую основу знаний грамматики русского языка и приобрести навыки устной и письменной речи, а также привести в систему знания по общеобразовательным дисциплинам по профилю дополнительной общеобразовательной программы. </p><p>Учебная программа начинается с&nbsp;письменного и устного тестирования&nbsp;для определения уровня владения русским языком и подбора соответствующей группы по&nbsp;пятиуровневой системы обучения&nbsp;– от начального до продвинутого. Все программы по русскому языку на подготовительном отделении построены по&nbsp;интенсивной системе обучения. </p><p><br></p><p>	<strong>Внеучебная деятельность</strong> является неотъемлемой частью образовательного процесса и направлена, в первую очередь, на приобщение к культуре страны пребывания. Слушатели подготовительного отделения активно принимают участие в конкурсах, олимпиадах, культурных, спортивных и других мероприятиях, проводимых в университете.&nbsp;</p><p><br></p><p>	<strong>Свидетельство</strong></p><p>	После окончания обучения и успешной сдачи экзаменов на подготовительном отделении иностранные граждане получают сертификат (свидетельство) о прохождении курса обучения по программе.</p><p>  </p><p><br></p><p>Будем рады видеть Вас в стенах нашего подготовительного отделения!</p><p> </p>','text',NULL,139,NULL,'2020-10-22 14:00:19','2020-10-22 14:00:19',NULL),(1005,NULL,NULL,0,'<p>	Иностранные граждане и лица без гражданства имеют право на получение высшего образования за счет бюджетных ассигнований наравне с гражданами Российской Федерации в соответствии с международными договорами Российской Федерации, а также иностранные граждане и лица без гражданства, являющиеся соотечественниками, проживающими за рубежом, имеют право на получение высшего образования наравне с гражданами Российской Федерации при условии соблюдения ими требований, предусмотренных статьей 17 Федерального закона от 24 мая 1999 г. № 99-ФЗ «О государственной политике Российской Федерации в отношении соотечественников за рубежом» (далее – Федеральный закон № 99-ФЗ).</p><p><br></p><p>	Чтобы подтвердить статус соотечественника, при подаче заявления на прохождение вступительных испытаний необходимо предоставить документы, подтверждающие, что Ваши родственники по восходящей линии были гражданами СССР:</p><ul><li>Ваш паспорт и свидетельство о рождении с переводом на русский язык, </li><li>паспорт и свидетельство о рождении с переводом на русский язык одного из родственников, рожденных в СССР. Если у родителя была осуществлена смена фамилии – необходим также документ, подтверждающий это (например, свидетельство о вступлении в брак) с переводом на русский язык.</li></ul>','text',NULL,140,NULL,'2020-10-22 14:00:19','2020-10-22 14:00:19',NULL),(1006,NULL,NULL,0,NULL,'files',NULL,141,NULL,'2020-10-22 14:00:19','2020-10-22 14:00:19',NULL),(1007,'Перечень вступительных испытаний для иностранных граждан, поступающех по договорам об оказании платных образовательных услуг','20201022_170019_5utu3rRUrAkW.pdf',0,'Приложение 6.pdf','file','537jessu6ju7jz6dqw0kk',NULL,1006,'2020-10-22 14:00:19','2020-10-22 14:00:19','pdf'),(1008,'Стоимость обучения на 1 курсе по программам бакалавриата, специалитета, магистратуры в 2020/2021 учебном году','20201022_170019_szvkzqfXA3EZ.pdf',1,'Выписка ВО иностранные граждане.PDF','file','5zk04erhyzj8ulyjtoxtom',NULL,1006,'2020-10-22 14:00:19','2020-10-22 14:00:19','PDF'),(1009,'Стоимость обучения на 1 курсе ординатуры в 2020/2021 учебном году','20201022_170019_hm8x1zasMqL2.pdf',2,'Стоимость ординатура иностранный граждане.PDF','file','e6kb48kxphu7u2xsavbvyf',NULL,1006,'2020-10-22 14:00:19','2020-10-22 14:00:19','PDF'),(1010,'Договор об образовании 2020-ингр','20201022_170019_89x410zKtgOq.doc',3,'Дог. об образ. 2020 ингр. 3-х стор-3-1.doc','file','vtmk1vf3e1lfaa9e863fm',NULL,1006,'2020-10-22 14:00:19','2020-10-22 14:00:19','doc'),(1011,'Agreement on education 2020','20201022_170019_7xdstuErh2Af.doc',4,'ENG-INDIA_NEW_ERA_20_21.doc','file','hvwz6z06ljpnd0op1un55o',NULL,1006,'2020-10-22 14:00:19','2020-10-22 14:00:19','doc'),(1012,NULL,NULL,0,'<p>	<strong>Может ли иностранный гражданин поступать на бюджет?</strong></p><p>	Иностранные граждане из Белоруссии, Казахстана, Киргизии и Таджикистана, а также соотечественники могут поступать на бюджетные места наравне с гражданами РФ в соответствии со ст. 17 Федерального закона от 24 мая 1999 г. N 99-ФЗ \"О государственной политике Российской Федерации в отношении соотечественников за рубежом\" (с изменениями и дополнениями). Конкурс на бюджетные места является общим.</p><p>	Иностранные граждане стран ближнего и дальнего зарубежья также могут поступать на бюджетную форму обучения по программам высшего образования через Россотрудничество в рамках квоты Правительства РФ. Система подачи заявок доступна по адресу <a href=\"https://www.russia.study/ru\" rel=\"noopener noreferrer\" target=\"_blank\">www.russia.study</a>.</p><p><br></p><p>	<strong>Как подтвердить статус соотечественника? </strong></p><p>	При подаче заявления на прохождение вступительных испытаний необходимо предоставить документы, подтверждающие, что Ваши родственники по восходящей линии были гражданами СССР (Ваш паспорт и&nbsp;свидетельство о рождении с переводом на русский язык, паспорт и свидетельство о рождении с переводом на русский язык одного из родственников, рожденных в СССР). Если у родителя была осуществлена смена фамилии – необходим также документ, подтверждающий это (например, свидетельство о вступлении в брак) с переводом на русский язык.</p><p><br></p><p>	<strong>Если иностранный гражданин сдал ЕГЭ, но результат не понравился, может ли он сдать вступительные испытания?</strong></p><p>	Да, иностранный абитуриент может подать документы и указать вступительные испытания по одному или нескольким предметам даже в том случае, если он сдавал по ним ЕГЭ. </p><p>	<span style=\"color: rgb(230, 0, 0);\">Важно!</span> После записи на вступительные испытания, результат ЕГЭ по этому предмету для нашего университета будет недействителен. Поэтому следует подойти к решению серьезно.</p><p><br></p><p>	<strong>Нотариальный перевод документов необходимо оформлять в России или можно у себя в стране?</strong></p><p>	Заверить переводы документов можно в консульском отделе Посольства Российской Федерации в своей стране, а также у нотариуса на территории Российской Федерации.</p><p><br></p><p>	<strong>Если документ об образовании оформлен на двух языках, один из которых – русский, нужен ли перевод информации на иностранном языке?</strong></p><p>	Если информация в документе об образовании полностью продублирована на русском языке, то дополнительно переводить документ не требуется.</p><p><br></p><p>	<strong>Как можно сдать экзамены дистанционно?</strong></p><p>	Вступительные испытания с применением дистанционных технологий проводятся на основании \"<a href=\"https://abiturs.mrsu.ru/storage/section-files/fuYIoA5vyvbCVV5bJ7Roze76ueUnDlawjUIUJDZk.pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Порядка проведения вступительных испытаний с применением дистанционных технологий в Федеральном государственном бюджетном образовательном учреждении высшего образования «Мордовский государственный университет им. Н.П. Огарёва»</a>\".</p><p><br></p><p>	<strong>На сколько направлений можно подать документы?</strong></p><p>	В соответствии с Правилами приема абитуриент имеет подать документы в 5 вузов на 3 направления подготовки в каждом вузе.</p><p><br></p><p>	<strong>Можно ли остановиться в общежитии на время сдачи вступительных испытаний?</strong></p><p>	Да, иностранные абитуриенты могут временно поселиться в общежитиях Студенческого городка Университета. При заселении необходимо предоставить документы, подтверждающие прохождение медицинского осмотра (справка), а также служебную записку, получаемую абитуриентом в Управлении международных связей при постановке на миграционный учет.</p>','text',NULL,142,NULL,'2020-10-22 14:00:19','2020-10-22 14:00:19',NULL),(1013,NULL,NULL,0,NULL,'text',NULL,143,NULL,'2020-10-22 14:00:19','2020-10-22 14:00:19',NULL),(1014,NULL,NULL,1,NULL,'files',NULL,143,NULL,'2020-10-22 14:00:19','2020-10-22 14:00:19',NULL),(1015,'Программы вступительных испытаний по общеобразовательным предметам','20201022_170019_dzlkvajGq3Vw.zip',0,'P4Ek3SLoQp9HWQYKqTih0ec7db7dxGb72IlT9oOX-1.zip','file','6tltyff207kat01b9km2n8',NULL,1014,'2020-10-22 14:00:19','2020-10-22 14:00:19','zip'),(1016,'Профессиональные и творческие испытания','20201022_170019_n2x2hgsFQPWl.zip',1,'GZH3qciynnvfWZNVwb9SbizRphn2v17fHOHrmyv0.zip','file','axeb848f8k40choqxctco8q',NULL,1014,'2020-10-22 14:00:19','2020-10-22 14:00:19','zip'),(1017,'I. ПРИЁМ ДОКУМЕНТОВ',NULL,0,'<p>	<strong>1. </strong>Начало приема документов, необходимых для поступления, на все формы обучения и направления подготовки – <strong><u>20 июня</u></strong>. Прием документов осуществляется ТОЛЬКО дистанционно!</p><p>	В личном кабинете абитуриента необходимо предоставить:</p><ul><li>скан документа, удостоверяющего личность;</li><li>скан документа об образовании (аттестат, диплом);</li><li>документы, удостоверяющие право на получение льгот, преимущественного права или подтверждение индивидуальных достижений (если имеются);</li><li>скан договора о целевом обучении (если имеется);</li><li>сканы документов, подтверждающих наличие индивидуальных достижений (удостоверение к золотому значку ГТО, книжка волонтера, дипломы или сертификаты, подтверждающие участие в олимпиадах и т.д.).</li></ul><p><br></p><p>	<strong>2. </strong>Абитуриенты, поступающие на основании аттестата о среднем общем образовании, должны иметь результаты ЕГЭ. Отдельные категории поступающих на базе среднего общего образования могут по своему усмотрению поступать на обучение по результатам общеобразовательных вступительных испытаний, проводимых университетом самостоятельно (раздел II Памятки).</p><p><br></p><p>	<strong>3. </strong>Все поступающие, независимо от уровня, формы и&nbsp;условий получения образования, в соответствии с законодательством должны представить в приемную комиссию <strong style=\"color: red;\">согласие на зачисление </strong><span style=\"color: black;\">тем же способом, каким было подано заявление на участие в конкурсе, то есть дистанционно</span>.&nbsp;Лица, не представившие в установленные сроки согласие на зачисление, зачислены не будут.</p><p><br></p><p><strong style=\"color: red;\">ВАЖНО! Оригинал документа об образовании нужно будет предоставить в вуз в течение первого года обучения!</strong></p><p><br></p><p>	<strong>4. </strong>При приеме на обучение по программам бакалавриата и специалитета по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения в рамках контрольных цифр устанавливаются следующие сроки завершения приема документов, необходимых для поступления:</p><ul><li>от лиц, поступающих по результатам ЕГЭ – <strong><u>18 августа;</u></strong></li><li><strong>от лиц, поступающих по результатам проводимых университетом самостоятельно вступительных испытаний (в том числе дополнительных вступительных испытаний творческой и (или) профессиональной направленности) – <u>6 августа</u></strong>.</li></ul><p><br></p><p>	<strong>5.</strong> При приеме на обучение по программам бакалавриата и специалитета по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения по договорам об оказании платных образовательных услуг устанавливаются следующие сроки завершения приема документов, необходимых для поступления:</p><ul><li>от лиц, поступающих на обучение &nbsp;по результатам ЕГЭ – &nbsp;<strong><u>26 августа</u></strong>; </li><li>от лиц, поступающих по результатам проводимых университетом самостоятельно вступительных испытаний (в том числе дополнительных вступительных испытаний творческой и (или) профессиональной направленности) – <strong><u>20 августа</u></strong>.</li></ul><p><br></p><p>	<strong>6.</strong> При приеме на обучение по программам бакалавриата и специалитета по <strong>заочной</strong> форме обучения в рамках контрольных цифр &nbsp;устанавливаются следующие сроки завершения приема документов, необходимых для поступления:</p><ul><li>от лиц, поступающих по результатам ЕГЭ – <strong><u>22 августа</u></strong>;</li><li>от лиц, поступающих на обучение по результатам проводимых университетом самостоятельно вступительных испытаний – <strong><u>15 августа</u></strong>.</li></ul><p><br></p><p>	<strong>7.</strong> При приеме на обучение по программам бакалавриата и специалитета по <strong>заочной</strong> форме обучения по договорам об оказании платных образовательных услуг устанавливаются следующие сроки завершения приема документов, необходимых для поступления:</p><ul><li>от лиц, поступающих по результатам ЕГЭ – <strong><u>5 сентября</u></strong>;</li><li>по результатам вступительных испытаний, проводимых университетом самостоятельно –<strong> <u>12 сентября</u></strong>.</li></ul><p><br></p><p>	<strong>8.</strong> Поступающий на обучение по программам бакалавриата или программам специалитета вправе подать заявление на участие в конкурсе не более чем по 3 специальностям и (или) направлениям подготовки в Университете, а также одновременно подать заявление (заявления) о приеме по результатам конкурса для обучения в Университете и его филиале (филиалах) или для обучения в нескольких филиалах, по различным формам обучения, по различным программам бакалавриата в пределах направления подготовки (программам специалитета в пределах специальности) либо по различным совокупностям программ бакалавриата в пределах направления подготовки (совокупностям программ специалитета в пределах специальности), по которым проводятся конкурсы, а также по различным видам приема, указанным в пункте 11 Правил.</p><p><br></p><p>	<strong>9.&nbsp;<u>Право на прием без вступительных испытаний</u></strong> имеют:</p><ul><li><span style=\"color: black;\">победители и призеры заключительного этапа всероссийской олимпиады школьников (далее – победители и призеры всероссийской олимпиады),</span></li><li><span style=\"color: black;\">члены сборных команд Российской Федерации, участвовавших в международных олимпиадах по общеобразовательным предметам и сформированных в порядке, установленном федеральным органом исполнительной власти, осуществляющим функции по выработке государственной политики и нормативно-правовому регулированию в сфере образования, по специальностям и (или) направлениям подготовки, соответствующим профилю всероссийской олимпиады школьников или международной олимпиады.</span></li></ul><p>	Право на прием на обучение за счет бюджетных ассигнований в пределах установленной квоты имеют <strong>дети-инвалиды, инвалиды I и II групп, инвалиды с детства, инвалиды вследствие военной травмы или заболевания, полученных в период прохождения военной службы, дети-сироты и дети, оставшиеся без попечения родителей, а также лица из числа детей-сирот и детей, оставшихся без попечения родителей, инвалиды войны, участники боевых действий, а также ветераны боевых действий из числа лиц, указанных в подпунктах 1-4 пункта 1 статьи 3 Федерального закона от 12 января 1995 г. № 5-ФЗ «О ветеранах»</strong>. Квота приема указанных категорий поступающих устанавливается ежегодно университетом в размере 10 процентов от общего объема контрольных цифр, выделенных организации высшего образования на очередной год, по специальностям и (или) направлениям подготовки. </p><p><br></p><p>	<strong>10. Преимущественное право зачисления (при прочих равных условиях) </strong>предоставляется лицам, перечисленным в п. 35 Правил приема. </p><p><br></p><p>	<strong>11. Победителям и призерам заключительного этапа Всероссийской олимпиады школьников по отдельным предметам </strong>предоставляются особые права (зачисление без вступительных испытаний или присвоение 100 баллов по профильному предмету) при приеме на обучение по программам бакалавриата и программам специалитета по специальностям и (или) направлениям подготовки, соответствующим профилю олимпиады школьников (Приложение 4 к Правилам приема).&nbsp;Для использования указанных особых прав наличие результатов ЕГЭ не требуется.</p><p><br></p><p>	<strong>12. Победителям и призерам олимпиад школьников, проводимых в порядке, устанавливаемом Минобрнауки России</strong>, предоставляются особые права (зачисление без вступительных испытаний или присвоение 100 баллов по профильному предмету) &nbsp;при приеме на обучение по программам бакалавриата и программам специалитета по специальностям и (или) направлениям подготовки, соответствующим профилю олимпиады школьников (Приложение 4 к Правилам приема). &nbsp;Для использования особого права победителям и призерам олимпиады школьников необходимо наличие результатов ЕГЭ <strong>не ниже 75 баллов ЕГЭ</strong> по общеобразовательному предмету, соответствующему профилю олимпиады.</p><p><br></p><p>	<strong>13.</strong> Поступающий не может одновременно подать заявление (заявления) о приеме на обучение на базе среднего общего образования и на базе профессионального образования в университете на одну и ту же образовательную программу.</p><p><br></p><p>	<strong>14.</strong> При поступлении на обучение по специальностям и направлениям подготовки: </p><ul><li><em>«Лечебное дело»,</em></li><li><em>«Педиатрия»,</em></li><li><em>«Стоматология»,</em></li><li><em>«Фармация»,</em></li><li><em>«Ветеринария»,</em></li><li><em>«Агроинженерия»,</em></li><li><em>«Теплоэнергетика и теплотехника»,</em></li><li><em>«Электроэнергетика и электротехника»,</em></li><li><em>«Эксплуатация транспортно-технологических машин и комплексов»,</em></li></ul><p>необходима <strong>медицинская справка</strong>, содержащая сведения о проведении медицинского осмотра в порядке, установленном постановлением Правительства Российской Федерации от 14 августа 2013 г. № 697.</p><p>	Медицинская справка признается действительной, если она получена не ранее года до дня завершения приема документов и вступительных испытаний.</p><p>	</p><p><strong style=\"color: red;\">ВАЖНО! Пройти медосмотр и предоставить медицинскую справку в вуз можно в течение первого года обучения!</strong></p><p><br></p>','text',NULL,144,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1018,'II. ВСТУПИТЕЛЬНЫЕ ИСПЫТАНИЯ',NULL,1,'<p>	<strong style=\"color: black;\">1. </strong>По одному общеобразовательному предмету проводится одно общеобразовательное вступительное испытание.</p><p><br></p><p>	<strong style=\"color: black;\">2. </strong>Поступающие по результатам ЕГЭ могут использовать:</p><ul><li>результаты 2020, 2019, 2018, 2017, 2016 гг.</li></ul><p>	Отдельные категории поступающих на базе среднего общего образования могут по своему усмотрению поступать на обучение по результатам общеобразовательных вступительных испытаний, проводимых университетом самостоятельно: </p><p>	а) дети-инвалиды, инвалиды;</p><p>	б) иностранные граждане;</p><p>	в) лица, которые прошли итоговые аттестационные процедуры в иностранных образовательных организациях, получили документ о среднем общем образовании в течение одного года до дня завершения приема документов и вступительных испытаний включительно;</p><p>	г) лица, поступающие на основании диплома о начальном профессиональном образовании, среднем профессиональном образовании или высшем образовании.</p><p>	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные <strong><u>документально</u></strong>), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p><br></p><p>	<strong style=\"color: black;\">3. </strong>Вступительные испытания организуются и проводятся с использованием средств информационно-коммуникационной сети «Интернет»&nbsp;в режиме видеоконференции или тестирования.&nbsp;&nbsp;&nbsp;</p><p>	Поступающие, участвующие во вступительных испытаниях, должны обеспечить наличие следующих компонентов: </p><p>	1) компьютер (операционная система не ниже Windows 7, macOS 11 и выше) с веб-камерой (встроенная, либо внешняя) с разрешением не менее 640х480 или смартфон (операционной системой Android не ниже 5.0, IOS не ниже 11.0) с камерой.</p><p>	2) канал доступа в информационно-коммуникационную сеть «Интернет» пропускной способностью не менее 5 Мбит/с.</p><p>	Техническое сопровождение организации и проведения вступительных испытаний со стороны университета осуществляется сотрудниками технического секретариата приемной комиссии, а также соответствующих подразделений университета. </p><p><br></p><p>	<strong style=\"color: black;\">4. </strong>Перед началом вступительного испытания ответственное лицо из состава технического секретариата приемной комиссии (далее – ответственное лицо) осуществляет идентификацию личности поступающего средствами телеконференцсвязи, определенной университетом, путём визуальной сверки предоставленной фотографии поступающего, документа удостоверяющего личность, с лицом, вышедшим на связь. В ходе идентификации также должны быть подтверждены персональные данные поступающего, указанные в заявлении (дата рождения, паспортные данные, адрес регистрации места жительства). </p><p>	Ответственное лицо проверяет состояние рабочего места поступающего. Для этого, с помощью веб-камеры поступающий должен обеспечить последовательный подробный обзор рабочего места для контроля присутствия посторонних лиц, справочной литературы и др. Во время вступительного испытания запрещается выключать видео- и аудио-режим трансляции. В случае обрыва связи, абитуриент должен немедленно возобновить соединение.</p><p><br></p><p>	<strong>5.</strong> Ход проведения вступительных испытаний: </p><p>	1) в форме тестирования – организуется на образовательном портале университета. С правилами тестирования и временем, которое отводится на выполнение заданий, поступающий знакомится на сайте&nbsp;перед тестированием. После завершения тестирования или истечения времени, которое отводится на выполнение заданий, выставляется оценка в соответствии с критериями оценки знаний. </p><p>	2) в форме устного экзамена – организуется средствами видеоконференцсвязи, определенной университетом: поступающий получает экзаменационные задания (билеты, вопросы для собеседования), определенные на сайте случайным образом; подготовка к ответу осуществляется непосредственно за тем же рабочим местом, где состоялась процедура идентификации. При подготовке к ответу оставляет записи на листе устного ответа, который затем сканируется (фотографируется) и размещается в личном кабинете поступающего. Через 30 минут, выделенных на подготовку, отвечает экзаменационной комиссии в режиме непосредственного общения с помощью средств телеконференцсвязи.</p><p><br></p><p>	<strong>6.</strong> Во время проведения вступительного испытания поступающий может пользоваться только письменными принадлежностями и чистыми листами. Во время проведения вступительного испытания поступающему запрещается пользоваться средствами связи.</p><p><br></p><p>	<strong>7. </strong>При нарушении поступающим во время проведения вступительного испытания с использованием дистанционных технологий настоящих Правил члены экзаменационной комиссии составляют акт о нарушении Правил.&nbsp;Электронная копия указанного акта направляется поступающему.&nbsp;Поступающий, в отношении которого составлен акт, признается не прошедшим вступительное испытание без уважительной причины. </p><p>	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные документально), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p><br></p><p>	<strong>8. </strong>В целях обеспечения контроля за проведением вступительных испытаний осуществляется видеозапись, о чем поступающего предупреждает ответственное лицо. Видеозаписи хранятся 1 год в электронной информационно-образовательной среде университета и могут быть использованы при рассмотрении апелляций.</p><p>&nbsp;</p><p>	<strong>9.</strong> Объявление оценок, полученных поступающими в ходе вступительных испытаний осуществляется на официальном сайте в следующем порядке: </p><ul><li>по письменным формам испытаний – не позднее трех рабочих со времени проведения испытания; </li><li>по устной форме – в течение 30 минут после ответа в режиме телеконференцсвязи, а также публикуются на официальном сайте не позднее следующего рабочего дня со времени проведения испытания.</li></ul><p><br></p>','text',NULL,144,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1019,'III. ПРОЦЕДУРА ЗАЧИСЛЕНИЯ В УНИВЕРСИТЕТ',NULL,2,'<p>	<strong style=\"color: black;\">1. </strong>По результатам приема документов и (или) вступительных испытаний Университет формирует списки поступающих (далее – списки поступающих):</p><p>	- списки поступающих без вступительных испытаний по каждой совокупности условий поступления &nbsp;в рамках контрольных цифр и на места по договорам об оказании платных образовательных услуг;</p><p>	- списки поступающих, успешно прошедших вступительные испытания (далее – конкурсные списки), по каждому конкурсу, проводимому в соответствии с пунктом 12 Правил.</p><p><br></p><p>	<strong style=\"color: black;\">2. </strong><span style=\"color: black;\">Конкурсные списки ранжируются следующим образом:</span></p><p>	<span style=\"color: black;\">а) по убыванию суммы конкурсных баллов (сумма баллов за вступительные испытания + баллы за индивидуальные достижения);</span></p><p>	<span style=\"color: black;\">б) при равенстве суммы конкурсных баллов – по убыванию суммы конкурсных баллов, начисленных по результатам вступительных испытаний, и по убыванию количества баллов, начисленных по результатам отдельных вступительных испытаний, в соответствии с приоритетностью вступительных испытаний, установленной Университетом (Приложение 3);</span></p><p>	<span style=\"color: black;\">в) при равенстве по предшествующим критериям более высокое место в списке занимают поступающие, имеющие преимущественное право зачисления.</span></p><p><br></p><p>	<strong style=\"color: black;\">3.</strong><span style=\"color: black;\"> Для зачисления, поступающие </span><strong style=\"color: red;\">тем же способом, что были поданы документы для участия в конкурсе на зачисление,</strong><span style=\"color: red;\"> &nbsp;</span><span style=\"color: black;\">представляют не позднее 18.00 по местному времени рабочего дня, установленного Университетом в качестве даты завершения приема документов, необходимых для поступления, </span><strong style=\"color: red;\">согласие на зачисление</strong><span style=\"color: black;\">. </span></p><p>	<span style=\"color: black;\">В списках поступающих по каждому поступающему указывается наличие в университете согласия на зачисление. </span></p><p><br></p><p>	<strong style=\"color: black;\">4.</strong><span style=\"color: black;\"> </span>Зачисление поступающих проводится в направлении от начала к концу списка поступающих, до заполнения имеющихся мест для приема.</p><p>	</p><p>	<strong>5.</strong> Процедуры зачисления поступающих на обучение по программам бакалавриата и специалитета по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p>	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>19 августа</u></strong>;</p><p>	б) зачисление поступающих без вступительных испытаний, поступающих на места в пределах квоты приема лиц, имеющих особые права, поступающих на места в пределах квоты целевого обучения:</p><p>	<strong><u>21 августа в 18.00</u></strong><u>: </u></p><p>	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, одновременно подавших заявления о приеме в соответствии с двумя или более подпунктами пункта 69 Правил в различные организации высшего образования;</p><p>	<strong><u>22 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих без вступительных испытаний, поступающих на места в пределах квоты приема лиц, имеющих особые права, поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p>	в) первый этап зачисления по общему конкурсу:</p><p>	<strong><u>22 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, равное числу поступающих без вступительных испытаний на места в рамках контрольных цифр, не представивших согласие на зачисление, а также на количество мест, оставшихся вакантными в пределах квоты приема лиц, имеющих особые права, и квоты целевого обучения;</p><p>	<strong><u>23 августа в 18.00: </u></strong></p><p>	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на первом этапе зачисления по общему конкурсу;</p><p>	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 80 процентов конкурсных мест по общему конкурсу (далее – список первого этапа);</p><p>	<strong><u>24 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки первого этапа;</p><p>	г) второй этап зачисления по общему конкурсу:</p><p>	<strong><u>24 августа</u> &nbsp;</strong>из конкурсных списков исключаются лица, зачисленные на первом этапе, количество конкурсных мест в конкурсных списках уменьшается на количество заполненных мест;</p><p>	<strong><u>25 августа в 18.00:</u></strong></p><p>	завершается прием согласия на зачисление от лиц, включенных в конкурсный список;</p><p>	лица, до установленного срока не представившие согласие на зачисление, а также отозвавшие указанное согласие, выбывают из конкурса и рассматриваются как отказавшиеся от зачисления;</p><p>	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу (далее – список второго этапа);</p><p>	<strong><u>26 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки второго этапа.</p><p>	</p><p>	<strong>6.</strong> При приеме на обучение по программам бакалавриата и специалитета по <strong>заочной</strong> форме обучения на места в рамках контрольных цифр приема:</p><p>	&nbsp;а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>24 августа</u></strong>;</p><p>	б) зачисление поступающих без вступительных испытаний, поступающих на места в пределах квоты приема лиц, имеющих особые права, поступающих на места в пределах квоты целевого приема: </p><p>	<strong><u>26 августа</u> </strong>завершается прием согласия на зачисление от лиц, одновременно подавших заявления о приеме в соответствии с двумя или более подпунктами пункта 69 Правил в различные организации высшего образования;</p><p>	<strong><u>27 августа</u> </strong>издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих без вступительных испытаний, поступающих на места в пределах квоты приема лиц, имеющих особые права, поступающих на места в пределах квоты целевого обучения, представивших оригинал документа установленного образца.</p><p>	<strong><u>27 августа</u> </strong>&nbsp;количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, равное числу поступающих без вступительных испытаний на места в рамках контрольных цифр, не представивших оригинал документа установленного образца и (или) согласие на зачисление, а также на количество мест, оставшихся вакантными в пределах квоты приема лиц, имеющих особые права, и квоты целевого обучения;</p><p>	<strong><u>27 августа</u> </strong>завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными по общему конкурсу;</p><p>	<strong><u>28 августа </u>&nbsp;</strong>издается и размещается на официальном сайте приказ (приказы) о зачислении лиц до заполнения 100 процентов конкурсных мест по общему конкурсу.</p><p>	</p><p>	<strong>7.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам бакалавриата и программам специалитета по очной, очно-заочной формам обучения:</p><p>	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>27 августа</u></strong>;</p><p>	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p>	<strong><u>29 августа</u></strong> завершается прием заявлений о согласии на зачисление;</p><p>	<strong><u>31 августа</u></strong> издается приказ (приказы) о зачислении.</p><p>	&nbsp;</p><p>	<strong>8.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам бакалавриата и программам специалитета по заочной форме обучения:</p><p>	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>14 сентября</u></strong>;</p><p>	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p>	<strong><u>16 сентября</u></strong> завершается прием заявлений о согласии на зачисление;</p><p>	<strong><u>18 сентября</u></strong> издается приказ (приказы) о зачислении.</p><p><br></p><p>	<strong style=\"color: red;\">ВАЖНО! Обязательным условием зачисления на места с оплатой стоимости обучения является заключение договора об оказании платных образовательных услуг и внесение предоплаты, размер которой согласуется при заключении договора.</strong></p><p><br></p>','text',NULL,144,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1020,NULL,NULL,4,NULL,'files',NULL,144,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1021,'Памятка (бакалавриат и специалитет)','20201022_170114_m5xst4I78Ykr.pdf',0,'Памятка-бакалавры и специалисты-2020.pdf','file','ceskigh5iq5wm8tbhrsud',NULL,1020,'2020-10-22 14:01:14','2020-10-22 14:01:14','pdf'),(1022,'IV. УЧЁТ РЕЗУЛЬТАТОВ ИНДИВИДУАЛЬНЫХ ДОСТИЖЕНИЙ',NULL,3,'<p>	<strong>1.</strong> Поступающие на обучение вправе представить сведения о своих индивидуальных достижениях, результаты которых учитываются при приеме на обучение.</p><p><br></p><p>	<strong>2.</strong> Учет индивидуальных достижений осуществляется посредством начисления баллов за индивидуальные достижения. Указанные баллы начисляются поступающему, представившему документы, подтверждающие получение результатов индивидуальных достижений, и включаются в сумму конкурсных баллов.</p><p><br></p><p>	<strong>3.</strong> При приеме на обучение по программам бакалавриата, программам специалитета Университет начисляет баллы за следующие индивидуальные достижения:</p><p>	а) наличие статуса чемпиона и призера Олимпийских игр, Паралимпийских игр и Сурдлимпийских игр, чемпиона мира, чемпиона Европы, победителя первенства мира, первенства Европы по видам спорта, включенным в программы Олимпийских игр, Паралимпийских игр и Сурдлимпийских игр; наличие золотого значка, полученного за результаты сдачи норм физкультурного комплекса «Готов к труду и обороне» (подтверждается удостоверением к нему); осуществление волонтерской (добровольческой) деятельности (при наличии книжки волонтера) – 2 балла;</p><p>	б) наличие аттестата о среднем общем образовании с отличием или аттестата о среднем общем образовании (среднем (полном) общем образовании), содержащего сведения о награждении золотой или серебряной медалью, диплома среднего профессионального образования с отличием – 5 баллов;</p><p>	в) участие и (или) результаты участия поступающих в олимпиадах (не используемые для получения особых прав и (или) преимуществ при поступлении на обучение по конкретной совокупности условий поступления) и иных интеллектуальных и (или) творческих конкурсах, физкультурных мероприятиях и спортивных мероприятиях, проводимых в целях выявления и поддержки лиц, проявивших выдающиеся способности – не более 3 баллов:</p><ul><li>участие во всех этапах Всероссийской олимпиады школьников (за исключением школьного и муниципального этапов), в олимпиадах школьников, включенных в перечень, утвержденный Министерством науки и высшего образования Российской Федерации; наличие статуса победителя регионального или вузовского чемпионата по профессиональному мастерству, проводимого Союзом «Молодые профессионалы (Ворлдскиллс Россия)»; наличие статуса победителя чемпионата по профессиональному мастерству среди инвалидов и лиц с ограниченными возможностями здоровья «Абилимпикс» – 3 балла;</li><li>результаты (победитель или призер) участия в олимпиадах и конкурсах, проводимых в Республике Мордовия – 2 балла;</li><li>результаты (победитель или призер) участия в олимпиадах и конкурсах, проводимых МГУ им. Н.П. Огарёва – 2 балла.</li></ul><p>Указанные результаты могут быть учтены в качестве индивидуального достижения, если подтверждающие документы получены не ранее 4 лет до дня завершения приема документов от поступающего и вступительных испытаний.</p>','text',NULL,144,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1023,'IV. УЧЁТ РЕЗУЛЬТАТОВ ИНДИВИДУАЛЬНЫХ ДОСТИЖЕНИЙ',NULL,3,'<p>Перечень индивидуальных достижений и подтверждающих их документов приведен в таблице:</p><p><img src=\"data:image/png;base64,\"></p><p><img src=\"data:image/png;base64,\"></p>','text',NULL,147,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1024,'II. ВСТУПИТЕЛЬНЫЕ ИСПЫТАНИЯ',NULL,1,'<p>	<strong style=\"color: black;\">1. </strong>Для поступления на программы магистратуры поступающий сдает междисциплинарный экзамен по программе соответствующего бакалавриата, которые размещены по <a href=\"https://abiturs.mrsu.ru/Magistratura-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">ссылке</a>.</p><p><br></p><p>	<strong style=\"color: black;\">2. </strong>Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные <strong><u>документально</u></strong>), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p><br></p><p>	<strong style=\"color: black;\">3. </strong>Вступительные испытания организуются и проводятся с использованием средств информационно-коммуникационной сети «Интернет»&nbsp;в режиме видеоконференции или тестирования.&nbsp;&nbsp;&nbsp;</p><p>	Поступающие, участвующие во вступительных испытаниях, должны обеспечить наличие следующих компонентов: </p><p>	1) компьютер (операционная система не ниже Windows 7, macOS 11 и выше) с веб-камерой (встроенная, либо внешняя) с разрешением не менее 640х480 или смартфон (операционной системой Android не ниже 5.0, IOS не ниже 11.0) с камерой.</p><p>	2) канал доступа в информационно-коммуникационную сеть «Интернет» пропускной способностью не менее 5 Мбит/с.</p><p>	Техническое сопровождение организации и проведения вступительных испытаний со стороны университета осуществляется сотрудниками технического секретариата приемной комиссии, а также соответствующих подразделений университета. </p><p><br></p><p>	<strong style=\"color: black;\">4. </strong>Перед началом вступительного испытания ответственное лицо из состава технического секретариата приемной комиссии (далее – ответственное лицо) осуществляет идентификацию личности поступающего средствами телеконференцсвязи, определенной университетом, путём визуальной сверки предоставленной фотографии поступающего, документа удостоверяющего личность, с лицом, вышедшим на связь. В ходе идентификации также должны быть подтверждены персональные данные поступающего, указанные в заявлении (дата рождения, паспортные данные, адрес регистрации места жительства). </p><p>	Ответственное лицо проверяет состояние рабочего места поступающего. Для этого, с помощью веб-камеры поступающий должен обеспечить последовательный подробный обзор рабочего места для контроля присутствия посторонних лиц, справочной литературы и др. Во время вступительного испытания запрещается выключать видео- и аудио-режим трансляции. В случае обрыва связи, абитуриент должен немедленно возобновить соединение.</p><p><br></p><p>	<strong>5.</strong> Ход проведения вступительных испытаний: </p><p>	1) в форме тестирования – организуется на образовательном портале университета. С правилами тестирования и временем, которое отводится на выполнение заданий, поступающий знакомится на сайте&nbsp;перед тестированием. После завершения тестирования или истечения времени, которое отводится на выполнение заданий, выставляется оценка в соответствии с критериями оценки знаний. </p><p>	2) в форме устного экзамена – организуется средствами видеоконференцсвязи, определенной университетом: поступающий получает экзаменационные задания (билеты, вопросы для собеседования), определенные на сайте случайным образом; подготовка к ответу осуществляется непосредственно за тем же рабочим местом, где состоялась процедура идентификации. При подготовке к ответу оставляет записи на листе устного ответа, который затем сканируется (фотографируется) и размещается в личном кабинете поступающего. Через 30 минут, выделенных на подготовку, отвечает экзаменационной комиссии в режиме непосредственного общения с помощью средств телеконференцсвязи.</p><p><br></p><p>	<strong>6. </strong>Во время проведения вступительного испытания поступающий может пользоваться только письменными принадлежностями и чистыми листами. Во время проведения вступительного испытания поступающему запрещается пользоваться средствами связи.</p><p><br></p><p>	<strong>7. </strong>При нарушении поступающим во время проведения вступительного испытания с использованием дистанционных технологий настоящих Правил члены экзаменационной комиссии составляют акт о нарушении Правил.&nbsp;Электронная копия указанного акта направляется поступающему.&nbsp;Поступающий, в отношении которого составлен акт, признается не прошедшим вступительное испытание без уважительной причины. </p><p>	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные документально), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p><br></p><p>	<strong>8.</strong> В целях обеспечения контроля за проведением вступительных испытаний осуществляется видеозапись, о чем поступающего предупреждает ответственное лицо. Видеозаписи хранятся 1 год в электронной информационно-образовательной среде университета и могут быть использованы при рассмотрении апелляций.&nbsp;&nbsp;&nbsp;</p><p><br></p><p>	<strong>9.</strong> Объявление оценок, полученных поступающими в ходе вступительных испытаний осуществляется на официальном сайте в следующем порядке: </p><p>	– по письменным формам испытаний – не позднее трех рабочих со времени проведения испытания; </p><p>	– по устной форме – в течение 30 минут после ответа в режиме телеконференцсвязи, а также публикуются на официальном сайте не позднее следующего рабочего дня со времени проведения испытания.</p><p>&nbsp;</p>','text',NULL,147,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1025,'III. ПРОЦЕДУРА ЗАЧИСЛЕНИЯ В УНИВЕРСИТЕТ',NULL,2,'<p>	<strong style=\"color: black;\">1.&nbsp;</strong>По результатам приема документов и (или) вступительных испытаний Университет формирует списки поступающих (далее – списки поступающих). </p><p>	</p><p>	<strong style=\"color: black;\">2. </strong><span style=\"color: black;\">Конкурсные списки ранжируются по убыванию суммы конкурсных баллов (сумма баллов за вступительные испытания + баллы за индивидуальные достижения. </span></p><p>	</p><p>	<strong style=\"color: black;\">3.</strong><span style=\"color: black;\"> Для зачисления, поступающие </span><strong style=\"color: red;\">тем же способом, что были поданы документы для участия в конкурсе на зачисление,</strong><span style=\"color: red;\"> &nbsp;</span><span style=\"color: black;\">представляют не позднее 18.00 по местному времени рабочего дня, установленного Университетом в качестве даты завершения приема документов, необходимых для поступления, </span><strong style=\"color: red;\">согласие на зачисление</strong><span style=\"color: black;\">. </span></p><p>	<span style=\"color: black;\">В списках поступающих по каждому поступающему указывается наличие в университете согласия на зачисление.</span></p><p><span style=\"color: black;\"> </span></p><p>	<strong style=\"color: black;\">4.</strong><span style=\"color: black;\"> </span>Зачисление поступающих проводится в направлении от начала к концу списка поступающих, до заполнения имеющихся мест для приема.</p><p><br></p><p>	<strong>5.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p>	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>10 августа</u></strong>;</p><p>	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p>	<strong><u>12 августа в 18.00</u></strong><u>: </u></p><p>	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p>	<strong><u>13 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p>	в) этап зачисления по общему конкурсу:</p><p>	<strong><u>13 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p>	<strong><u>13 августа в 18.00: </u></strong></p><p>	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p>	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p>	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p><br></p><p>	<strong>6.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>заочной</strong> форме обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p>	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>12 августа</u></strong>;</p><p>	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p>	<strong><u>13 августа в 18.00</u></strong><u>: </u></p><p>	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p>	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p>	в) этап зачисления по общему конкурсу:</p><p>	<strong><u>14 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p>	<strong><u>14 августа в 18.00: </u></strong></p><p>	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p>	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p>	<strong><u>15 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p><br></p><p>	<strong>7.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам магистратуры &nbsp;по очной, очно-заочной и заочной формам обучения:</p><p>	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>28 августа</u></strong>;</p><p>	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p>	<strong><u>29 августа</u></strong> завершается прием заявлений о согласии на зачисление;</p><p>	<strong><u>31 августа</u></strong> издается приказ (приказы) о зачислении.</p><p><br></p><p>	<strong style=\"color: red;\">ВАЖНО! Обязательным условием зачисления на места с оплатой стоимости обучения является заключение договора об оказании платных образовательных услуг и внесение предоплаты, размер которой согласуется при заключении договора.</strong></p><p><br></p>','text',NULL,147,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1026,NULL,NULL,4,NULL,'files',NULL,147,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1027,'Памятка магистратура 2020','20201022_170114_axcm2bReBMEK.pdf',0,'Памятка-магистры-2020.pdf','file','pyb7zbzwvhdfabgl4dy9jp',NULL,1026,'2020-10-22 14:01:14','2020-10-22 14:01:14','pdf'),(1028,'I. ПРИЁМ ДОКУМЕНТОВ',NULL,0,'<p>	<strong>1. </strong>Начало приема документов, необходимых для поступления, на все формы обучения и направления подготовки – <strong><u>20 июня</u></strong>. Прием документов осуществляется <strong style=\"color: red;\">ТОЛЬКО </strong>дистанционно!</p><p>	В личном кабинете абитуриента необходимо предоставить:</p><ul><li>скан документа, удостоверяющего личность;</li><li>скан документа об образовании (диплом бакалавра, диплом специалиста);</li><li>скан договора о целевом обучении (если имеется);</li><li>сканы документов, подтверждающих наличие индивидуальных достижений (в соответствии с перечнем, приведенным в Приложении 5 к Правилам приема). </li></ul><p><br></p><p>	<strong>2. </strong>Все поступающие, независимо от уровня, формы и&nbsp;условий получения образования, в соответствии с законодательством должны представить в приемную комиссию <strong style=\"color: red;\">согласие на зачисление </strong><span style=\"color: black;\">тем же способом, каким было подано заявление на участие в конкурсе, то есть дистанционно</span>.&nbsp;Лица, не представившие в установленные сроки согласие на зачисление, зачислены не будут. </p><p><br></p><p><span class=\"ql-cursor\">﻿﻿﻿</span>	<strong style=\"color: red;\">ВАЖНО! Оригинал документа об образовании нужно будет предоставить в вуз в течение первого года обучения!</strong></p><p><br></p><p>	<strong>3. </strong>При приеме на обучение по программам магистратуры по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения в рамках контрольных цифр прием документов, необходимых для поступления, завершается – <strong><u>3 августа. </u></strong>Вступительные испытания проводятся в период с <strong><u>4 по 8 августа</u></strong>. </p><p><br></p><p>	<strong>4. </strong>При приеме на обучение по программам магистратуры по <strong>заочной</strong> форме обучения в рамках контрольных цифр &nbsp;прием документов, необходимых для поступления, завершается – <strong><u>7 августа. </u></strong>Вступительные испытания проводятся в период с <strong><u>8 по 11 августа</u></strong>. </p><p><br></p><p>	<strong>5. </strong>При приеме на обучение по программам магистратуры по <strong>очной,</strong> <strong>очно-заочной</strong> и заочной формам обучения по договорам об оказании платных образовательных услуг прием документов, необходимых для поступления, завершается – &nbsp;<strong><u>24 августа</u></strong>. Вступительные испытания проводятся в период с <strong><u>25 по 27 августа</u></strong>. </p><p><br></p><p>	<strong>6.</strong> При поступлении на обучение по специальностям и направлениям подготовки:</p><ul><li><em>«Лечебное дело», </em></li><li><em>«Педиатрия», </em></li><li><em>«Стоматология», </em></li><li><em>«Фармация», </em></li><li><em>«Ветеринария», </em></li><li><em>«Агроинженерия», </em></li><li><em>«Теплоэнергетика и теплотехника», </em></li><li><em>«Электроэнергетика и электротехника», </em></li><li><em>«Эксплуатация транспортно-технологических машин и комплексов»,</em> </li></ul><p>необходима <strong>медицинская справка</strong>, содержащая сведения о проведении медицинского осмотра в порядке, установленном постановлением Правительства Российской Федерации от 14 августа 2013 г. № 697.</p><p>	Медицинская справка признается действительной, если она получена не ранее года до дня завершения приема документов и вступительных испытаний.</p><p><br></p><p>	<strong style=\"color: red;\">ВАЖНО! Пройти медосмотр и предоставить медицинскую справку в вуз можно в течение первого года обучения!</strong></p><p><br></p>','text',NULL,147,NULL,'2020-10-22 14:01:14','2020-10-22 14:01:14',NULL),(1029,' Pre-University tutorials department',NULL,0,'<p class=\"ql-align-justify\">Pre-University tutorials department offers preparatory courses for foreign citizens and persons without citizenship to be able to further apply for degree programs in Russian.</p><p class=\"ql-align-justify\">Academic profiles taught are:</p><p class=\"ql-align-justify\"><br></p><ul><li class=\"ql-align-justify\">Natural science (Russian language, mathematics, physics and chemistry);</li><li class=\"ql-align-justify\">Engineering and technology (Russian language, mathematics, physics and computer science);</li><li class=\"ql-align-justify\">Humanities (Russian language, social studies, history and literature);</li><li class=\"ql-align-justify\">Economics (Russian language, social studies, history and mathematics);</li><li class=\"ql-align-justify\">Medicine and biology (Russian language, chemistry, biology and physics).</li></ul>','text',NULL,148,NULL,'2020-10-22 14:02:08','2020-10-22 14:02:08',NULL),(1030,'Academic studies',NULL,1,'<p class=\"ql-align-justify\">Students learn Russian, as well as general education subjects to be able to apply for a degree program in Russian. The Russian language course is a major part of the preparatory courses curriculum. </p><p class=\"ql-align-justify\">Classes in Russian give a unique opportunity for foreign students to lay a solid foundation in Russian grammar and acquire oral and written language skills, as well as to compartmentalize knowledge in subjects of the chosen academic profile.</p><p>Prior to classes, learners are tested as to determine the level of Russian language proficiency and be put in the appropriate group within the five language levels - from elementary to advanced. All Russian language programs are studied in a fast-paced learning mode.</p><p><br></p><p><strong>Extracurricular activities</strong> are an integral part of the educational process and primarily aimed at introducing a learner to the culture of the host country. This is done by getting learners involved in competitions, academic Olympics, cultural, sports and other events held at the University.</p>','text',NULL,148,NULL,'2020-10-22 14:02:08','2020-10-22 14:02:08',NULL),(1031,'Certificate of completion',NULL,2,'<p class=\"ql-align-justify\">After completion of their studies and successful passing of the examinations at the Pre-University Tutorials Department, foreign citizens are issued a certificate of completion of the course.</p>','text',NULL,148,NULL,'2020-10-22 14:02:08','2020-10-22 14:02:08',NULL),(1032,' ',NULL,0,'<p><strong>1. </strong>Foreign citizens and persons without citizenship have the right to higher education at the expense of Russian federal budget allocations (state-financed education) in accordance with </p><p>	a) international treaties of the Russian Federation, </p><p>	b) federal laws or </p><p>	c) the quota established by the Government of the Russian Federation for the education of foreign citizens and persons without citizenship (hereinafter referred to as the education quota), as well as </p><p>	d) at their own funds by negotiating contracts on reimbursement of fee-based educational services.</p><p><br></p><p><strong>2. </strong>Admission to study within the education quota for foreign citizens is carried out following the referral of the Federal Executive authority responsible for the formulation of state policy and legal regulation in the field of education. Matriculation to the University within the education quota is carried out by a separate order (orders) issued by the University.</p><p><br></p><p><strong>3. </strong>Foreign citizens and persons without citizenship who are fellow nationals (compatriots) living abroad have the right to higher education on an equal basis with citizens of the Russian Federation, provided that they comply with the requirements stipulated by the article 17 of Federal law No. 99-FZ dated of May 24, 1999 \"On state policy of the Russian Federation in relation to fellow nationals abroad\" (hereinafter referred to as Federal law No. 99-FZ).</p><p><br></p><p><strong>4.</strong> Fellow nationals abroad who are not citizens of the Russian Federation are not subject to special rights for admission to bachelor and specialist (5-year curriculum) programs offered in accordance with Federal law No. 273-FZ, unless otherwise specified by an international agreement of the Russian Federation.</p><p><br></p><p><strong>5.</strong> When admitting foreign citizens and persons without citizenship to study bachelor and speciality (5-year curriculum) programs for places allocated for contracts on reimbursement of fee-based educational services (fee-based tuition), entrance trials are carried out in accordance with <u>Annex 6.</u> In this regard, a separate number of places for admission is allocated for foreign citizens and persons without citizenship and a separate competition is held for these places.</p><p><br></p><p><strong>6.</strong> Documents are accepted within the following deadlines:</p><p>	<img src=\"//:0\">1) foreign citizens and persons without citizenship specified in paragraph 5 above, apply within the time frame set by paragraph 18 of the Rules; </p><p>	2) foreign citizens and persons without citizenship applying for education under contracts on reimbursement of fee-based educational services (fee-based tuition), apply from <strong>June 20 to October 17, 2020.</strong></p><p><br></p><p><strong>7.</strong> When applying for admission to study a foreign citizen or a person without citizenship specifies in the application form the details of the identity document in accordance with article 10 of the Federal law of 25 July 2002&nbsp;No. 115-FZ \"On the legal status of foreign citizens in the Russian Federation\" (hereinafter referred to as the identity document of a foreign citizen), and submits, in accordance with subparagraph 1 of paragraph 68 of the Rules, an original or a copy of the identity document of a foreign citizen.</p><p><br></p><p><strong>8.</strong> When applying for admission in accordance with article 17 of Federal law No. 99-FZ, a fellow national (compatriot) submits, in addition to the documents specified in paragraph 68 of the Rules, originals or copies of documents provided for in article 17 of Federal law No. 99-FZ. Foreign citizens who apply on the basis of international agreements, in addition to the documents specified in paragraph 68 of the Procedure, submit documents confirming their classification as persons specified in the relevant international agreements.</p><p><br></p><p><strong>9.</strong> Matriculation of foreign citizens and persons without citizenship specified in paragraph 133 of the present policy to places financed from budget allocations is carried out within the time frame set in paragraphs 118-123 of the Rules.</p><p><br></p><p><strong>10.</strong> Matriculation of foreign citizens and persons without citizenship to places under contracts on rendering fee-based educational services (fee-based tuition) is carried out until October 24, 2020.</p><p><br></p><p><strong>11.</strong> Admission of foreign citizens and persons without citizenship to educational programs containing information constituting a state secret is carried out only within the education quota in compliance with the requirements stipulated by the legislation of the Russian Federation on state secrets.</p><p><br></p>','text',NULL,149,NULL,'2020-10-22 14:02:37','2020-10-22 14:02:37',NULL),(2,' ПРАВИЛА ПРИЁМА, УТВЕРЖДЁННЫЕ РЕШЕНИЕМ УЧЁНОГО СОВЕТА УНИВЕРСИТЕТА, НА 2020 ГОД',NULL,0,NULL,'files',NULL,1,NULL,'2020-01-28 13:41:31','2020-07-07 04:53:41',NULL),(462,'Положение о порядке снижения стоимости','B4NJDRIZ0jUIloFxWq0wFXBgEb7pTFT71bQ5WVp2.pdf',3,'Положение о порядке снижения стоимости обучения.pdf','file','zy267kd6vhytggc4n8gf',NULL,432,'2020-06-23 10:12:41','2020-06-23 10:12:41','pdf'),(463,'Положение о порядке снижения стоимости','yX05HUzsUIpfka9Fo1aNRYQ7AQESXT1ZPV5PMxSs.pdf',3,'Положение о порядке снижения стоимости обучения.pdf','file','kefdnbyl41m5fxy3ztwii',NULL,396,'2020-06-23 10:13:14','2020-06-23 10:13:14','pdf'),(10,'ОБ УТВЕРЖДЕНИИ ПЕРЕЧНЯ ОЛИМПИАД',NULL,0,NULL,'files',NULL,5,NULL,'2020-01-31 10:24:04','2020-02-03 06:25:18',NULL),(12,'Перечень олимпиад','bm7rr2pe3zRpARuiHIfmVM20i9MvnkxnB3KlqVFx.pdf',0,'Перечень олимпиад.pdf','file','a06zmrmrdalee3c2vvt3k7',NULL,10,'2020-01-31 10:25:09','2020-02-03 06:25:18','pdf'),(17,'',NULL,0,'<p>В связи с угрозой распространения новой коронавирусной инфекции (COVID-19)&nbsp;«Дни открытых дверей» институтов и факультетов не проводятся. Интересующую информацию можно найти на сайтах институтов и факультетов (раздел «Университет» по <a href=\"https://mrsu.ru/ru/struct/\" rel=\"noopener noreferrer\" target=\"_blank\">ссылке</a>). Также вы можете задать вопросы на адреса электронной почты соответствующих институтов и факультетов или приемной комиссии университета. </p><p><br></p>','text',NULL,3,NULL,'2020-02-03 06:22:28','2020-06-02 14:03:45',NULL),(18,'ОБ УТВЕРЖДЕНИИ ДОПОЛНИТЕЛЬНОГО ПЕРЕЧНЯ ОЛИМПИАД',NULL,1,NULL,'files',NULL,5,NULL,'2020-02-03 06:25:54