L,'files',NULL,158,NULL,'2020-10-22 14:22:47','2020-10-22 14:22:47',NULL),(1061,'Приказ от 14.08.2020 №166-а о зачислении (очная форма обучения, целевой приём)','ZZyx6J6t06fyHXXOkEiDOZDOAMZPda9BE29FR44h.pdf',0,'Приказ от 14.08.2020 №166-а о зачислении (очная форма обучения, целевой приём).pdf','file','afff0v369vdku59j8e4e5a',NULL,1060,'2020-10-22 14:22:47','2020-10-22 14:22:47','pdf'),(1057,NULL,NULL,0,NULL,'files',NULL,161,NULL,'2020-10-22 14:20:52','2020-10-22 14:20:52',NULL),(1058,'Приказ от 25.08.2020 №5532-с об отмене зачисления','XaI9w55O0UhiALvxNdhz5EprmvW3N4KC6ywbFDbs.pdf',0,'Приказ от 25.08.2020 №5532-с об отмене зачисления.pdf','file','njb7umin2pcvrnv7fi5ua9',NULL,1057,'2020-10-22 14:20:52','2020-10-22 14:20:52','pdf'),(1054,'How can I take examinations online?',NULL,5,'<p>Entrance tests with the use of remote learning technologies are carried out in compliance with «The procedure for conducting entrance tests with the use of remote learning technologies at the Federal state budgetary educational institution of higher education «Ogarev Mordovia State University».</p>','text',NULL,154,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(1055,'How many degree programs can I apply for?',NULL,6,'<p>In accordance with the Admission Rules, the applicant has the right to submit documents to 5 universities for 3 degree programs in each University.</p>','text',NULL,154,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(1056,'Can I stay in a dormitory while I go through the entrance trials?',NULL,7,'<p>Yes, foreign applicants can temporarily stay in dormitories on the University campus. By doing so, you must provide medical certificate ( proof of passed medical examination), and apply for an authorisation letter from International relations office when filing for migration registration there.</p>','text',NULL,154,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(1053,'If the education document is issued in two languages, one of which is Russian, do I need to translate the foreign language version?',NULL,4,'<p>If the information in the education document is a word for word translation into Russian, then you do not need to translate the document</p>','text',NULL,154,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(1052,'Shall a notarized translation of documents be made in Russia or in the country of my origin?',NULL,3,'<p>You can preferably certify translations of documents at the consular Department of the Embassy of the Russian Federation in your country, as well as at a notary in the Russian Federation.</p>','text',NULL,154,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(1050,'How to prove the status of a fellow national (compatriot)?',NULL,1,'<p>When applying for entrance trials, you must provide proof that Your ascendants were Soviet citizens (Your passport and birth certificate with translation into Russian language, passport and birth certificate with translation into Russian language of one of relatives born in the USSR). If a parent has changed his/her last name, you also have to submit a document confirming this (for instance, a marriage certificate) with a translation into Russian.</p>','text',NULL,154,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(1051,'If a foreign citizen passed the State Unified Examination (SUE), but is disappointed with its result, can s/he sit the entrance tests at the University?',NULL,2,'<p>Yes, a foreign applicant can submit documents and request entrance tests for one or more subjects, even if s/he passed the SUE in this or those subjects. </p><p><u style=\"color: rgb(230, 0, 0);\">Important!</u> After registering for the entrance tests, the results of the SUE in this/those subject renders it null and void for our University. Therefore, you should take the decision cautiously.</p>','text',NULL,154,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(1049,'Is a foreign citizen eligible to apply for a state-financed education (Russian federal budget place scheme)?',NULL,0,'<p>Foreign citizens from Belarus, Kazakhstan, Kyrgyzstan and Tajikistan, as well as compatriots, can apply for a state-financed scheme (budget places) on an equal basis with citizens of the Russian Federation in accordance with article 17 of the Federal law dated of May 24, 1999 N 99-FZ \"On state policy of the Russian Federation in relation to compatriots living abroad\" (with amendments and additions). The competition for budget places is General.</p><p>Foreign citizens of the near and far abroad countries can also apply for a state-financed education through Rossotrudnichestvo within the quota of the Government of the Russian Federation. The application system is available at <a href=\"https://www.russia.study\" rel=\"noopener noreferrer\" target=\"_blank\">www.russia.study</a></p>','text',NULL,154,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(1048,NULL,NULL,0,'<p>Foreign citizens and persons without citizenship have the right to receive higher education through budgetary allocations on par with citizens of the Russian Federation in accordance with international treaties of the Russian Federation;</p><p><br></p><p>also foreign citizens and persons without citizenship who are fellow nationals (compatriots) living abroad have the right to higher education on par with citizens of the Russian Federation under condition of their compliance with the requirements of article 17 of the Federal law issued on 24 May 1999 No. 99-FZ «On the state policy of the Russian Federation in relation to compatriots living abroad» (hereinafter referred to as Federal law No. 99-FZ).</p><p><br></p><p>To confirm the status of a compatriot, when applying for entrance trials, you must provide documents confirming that Your ascendants were citizens of the USSR:</p><p><br></p><ul><li>Your passport and birth certificate with translation into Russian,</li><li>passport and birth certificate with translation into Russian of one of the relatives born in the USSR. If a parent has changed his/her last name, you must provide document confirming this (for example, a marriage certificate) with a translation into Russian.</li></ul><p><br></p>','text',NULL,153,NULL,'2020-10-22 14:03:09','2020-10-22 14:03:09',NULL),(355,' ПРАВИЛА ПРИЕМА, УТВЕРЖДЁННЫЕ РЕШЕНИЕМ УЧЕНОГО СОВЕТА УНИВЕРСИТЕТА, НА 2020 ГОД',NULL,0,NULL,'files',NULL,47,NULL,'2020-06-18 13:24:07','2020-06-18 13:24:07',NULL),(553,NULL,NULL,0,NULL,'files',NULL,75,NULL,'2020-06-26 21:25:00','2020-08-25 13:05:50',NULL),(554,'Информация для поступающих (презентация) от 25 июня 2020','LO4FWGS8eNRRV9JDyfdlPYtzkjEM8YegmSMed5tb.ppt',0,'Информация для поступающих (презентация) от 25 июня 2020 года.ppt','file','98wllgi55t5792qyw5up24',NULL,553,'2020-06-26 21:25:00','2020-06-26 21:25:00','ppt'),(460,'Положение о порядке снижения стоимости','uQUKdRb0rHxjlCU7oJJlohf9QhoedEQvFPuR5GaY.pdf',4,'Положение о порядке снижения стоимости обучения.pdf','file','7he17n79jt2wsysp732s2',NULL,143,'2020-06-23 10:11:48','2020-06-23 10:11:48','pdf'),(461,'Положение о порядке снижения стоимости','61cIsrtaItL6CXPRmNKI7jw4rOfQQga9P5hC12vH.pdf',1,'Положение о порядке снижения стоимости обучения.pdf','file','svf6wlycgbpvqlmyg2alcs',NULL,117,'2020-06-23 10:12:10','2020-06-23 10:12:10','pdf'),(470,'Вступительные испытания. Шкала оценивания, минимальный балл.','YSWl7fG9RJUPotR0UhsnfWfbgQAjcLNAh1OtVkqE.pdf',3,'Вступительные испытания. Язык, способ проведения. Шкала оценивания, минимальный балл..pdf','file','dcys639lu1tewh6eb5png',NULL,469,'2020-06-23 13:55:54','2020-08-25 12:57:28','pdf'),(363,'КОЛИЧЕСТВО МЕСТ ДЛЯ ПРИЕМА НА ОБУЧЕНИЕ ПО РАЗЛИЧНЫМ УСЛОВИЯМ ПОСТУПЛЕНИЯ',NULL,1,NULL,'files',NULL,47,NULL,'2020-06-18 13:24:07','2020-06-18 13:24:07',NULL),(364,'Количество мест для приема на обучение по каждой совокупности условий поступления','tpX1bnD4ACVoO4HZ9bVsaSNILBWmLn2iIRSVQsd4.pdf',0,'Приложение 2__.pdf','file','mir9sbmhqz5luwrfwxyh3',NULL,363,'2020-06-18 13:24:07','2020-07-22 11:01:35','pdf'),(365,'ИНФОРМАЦИЯ О СРОК