ой инфекции (COVID-19)&nbsp;«Дни открытых дверей» институтов и факультетов не проводятся. Интересующую информацию можно найти на сайтах институтов и факультетов (раздел «Университет» по <a href=\"https://mrsu.ru/ru/struct/\" rel=\"noopener noreferrer\" target=\"_blank\">ссылке</a>). Также вы можете задать вопросы на адреса электронной почты соответствующих институтов и факультетов или приемной комиссии университета. </p><p><br></p>','text',NULL,48,NULL,'2020-06-18 13:24:07','2020-06-18 13:24:07',NULL),(408,'СТОИМОСТЬ ОБУЧЕНИЯ ДЛЯ ПОСТУПАЮЩИХ НА ПЕРВЫЙ КУРС В 2020-2021 УЧЕБНОМ ГОДУ',NULL,0,NULL,'files',NULL,49,NULL,'2020-06-18 13:24:07','2020-06-18 13:24:07',NULL),(409,'Стоимость_граждане РФ','2kuOC0ebXPFBg991MDC3wCwkPW9JEwImvIBzPJBz.pdf',0,'Высшее образование_граждане РФ.pdf','file','0hotxsggo528zi90qb3zrfj',NULL,408,'2020-06-18 13:24:07','2020-06-18 13:24:07','pdf'),(410,'Стоимость_граждане РФ (ускоренные сроки)','MgF3qno5JMFMQllFMPkdQVA9tOcg0yPCPokF9Wj3.pdf',1,'Высшее образование (ускоренное)_граждане РФ.pdf','file','mna6t46mgxb0my8cbjwran',NULL,408,'2020-06-18 13:24:07','2020-06-18 13:24:07','pdf'),(411,'Стоимость_иностр_граждане','2GwqfoICkvosT4UsT7J14724PGfNApR0fEF7TKiU.pdf',2,'Высшее образование_ иностранные граждане.pdf','file','xjthqz5pydxzxzhrfkfn8',NULL,408,'2020-06-18 13:24:07','2020-06-18 13:24:07','pdf'),(1041,'If a foreign citizen passed the State Unified Examination (SUE), but is disappointed with its result, can s/he sit the entrance tests at the University?',NULL,2,'<p>Yes, a foreign applicant can submit documents and request entrance tests for one or more subjects, even if s/he passed the SUE in this or those subjects. </p><p><u style=\"color: rgb(230, 0, 0);\">Important!</u> After registering for the entrance tests, the results of the SUE in this/those subject renders it null and void for our University. Therefore, you should take the decision cautiously.</p>','text',NULL,151,NULL,'2020-10-22 14:02:37','2020-10-22 14:02:37',NULL),(1042,'Shall a notarized translation of documents be made in Russia or in the country of my origin?',NULL,3,'<p>You can preferably certify translations of documents at the consular Department of the Embassy of the Russian Federation in your country, as well as at a notary in the Russian Federation.</p>','text',NULL,151,NULL,'2020-10-22 14:02:37','2020-10-22 14:02:37',NULL),(1043,'If the education document is issued in two languages, one of which is Russian, do I need to translate the foreign language version?',NULL,4,'<p>If the information in the education document is a word for word translation into Russian, then you do not need to translate the document.</p>','text',NULL,151,NULL,'2020-10-22 14:02:37','2020-10-22 14:02:37',NULL),(1125,'Приказ от 18.09.2020 №6582-с о зачислении (бакалавриат и специалитет, очная форма обучения, полное возмещение затрат)','3tcv569hEJtjExLVLI2Vz0iJnBBd2330mxu2HOwR.pdf',12,'Приказ от 18.09.2020 №6582-с о зачислении (бакалавриат и специалитет, очная форма обучения, полное возмещение затрат).pdf','file','hyp2ney4bnsec8e7urmknm',NULL,1112,'2020-10-22 14:34:03','2020-10-22 14:34:03','pdf'),(1126,'Приказ от 18.09.2020 №6585-с о зачислении (бакалавриат и специалитет, очная форма обучения, бюджетная основа, без вступительных испытаний)','g0ideouQjNQJhNAcwrZc1sKUslqPOXhlwIy1bDVK.pdf',13,'Приказ от 18.09.2020 №6585-с о зачислении (бакалавриат и специалитет, очная форма обучения, бюджетная основа, без вступительных испытаний).pdf','file','7bappen60dgqqrmhpbem4',NULL,1112,'2020-10-22 14:34:03','2020-10-22 14:34:03','pdf'),(1127,'Приказ от 21.08.2020 №5473-с о зачислении (бакалавриат и специалитет, очная форма обучения, бюджетная основа, без вступительных испытаний)','gG79312dizfqIV315eqabnBgCB4u981PVSyLvBTS.pdf',14,'Приказ от 21.08.2020 №5473-с о зачислении (бакалавриат и специалитет, очная форма обучения, бюджетная основа, без вступительных испытаний).pdf','file','i6qzh3nju8fhy2ltzo67tc',NULL,1112,'2020-10-22 14:34:03','2020-10-22 14:34:03','pdf'),(1128,'Приказ 